import './Modal.css';

const modal = (props) => {
    return (
        <div className="Modal">
            <div className="Modal-content">
                {props.message}
                <button onClick={props.click}>yes</button>
                <button>no</button>
            </div>
        </div>
    )
}

export default modal;
